  dbDatas: DBDatas[];
  match: string;
}

const Note = ({ dbDatas, match }: Prop) => {
  console.log(dbDatas);

  return (
    <section className={st.note}>
      {dbDatas.filter(
        (data) => data.title === match && <div>{data.words_en} </div>
      )}
